import React from 'react';
import './Nav.css';

export const Nav = () => {
  return (
    <div class="nav">
        <div class="leftnav"></div>
        <div class="buttons">
            <a href=''>Home</a>
            <a>About</a>
            <a>Dept</a>
            <a>Materials</a>
            <a>Contact</a>
            <a>Login</a>
        </div>
    </div>
  )
}
export default Nav;
